function App2() {

  const [ word , setWord] = useState('Bob')

  return (

    <>
      <Router>


        <header>
          hixcvbnnbvcxc12345{word}
        </header>
        <Navbar2 >

        </Navbar2>
        {/* <Bill/> */}

        <div className='main' style={{backgroundColor:"#F3F7FC", position: 'relative'}}>
          <Route exact path="/announce" exact={true} component={Announcep}/>
          <Route exact path="/bill" exact={true} component={Billpage}/>

          <Route exact path="/" exact={true} component={Socialcard}/>
          <Route exact path="/expense" exact={true} component={Expensepage}/>
          {/* render={(props) => <Book user={user} {...props} />} */}
          {/* <Route path="/expensehistory" exact={true} component={Exhistorypage} changeWord = {word => setWord(word)}/> */}

          <Route path="/expensehistory" exact={true} render={(props) => <Exhistorypage changeWord ={word => setWord(word)} {...props} />} />
          <Route path="/setting" exact={true} component={Setting}/>
          <Route path="/setting2" exact={true} component={Settingpage}/>
          <Route path="/momo" exact={true} component={Settingpage}/>
          {/* <Route path="/details" exact={true} component={Detailpage}/> */}
          <Route path="/details" exact={true} component={MoreDetail}/>
          <Route path="/billdetails" exact={true} component={DetailBillpage}/>
          <Route path="/historydetails" exact={true} component={Exdetailpage}/>

        </div>

      </Router>
    </>

  );
}

export default App2;
